import React, { useState } from "react";
import "../Styles/Contact.css";

function Contact() {
  const [formData, setFormData] = useState({
    cuname: "",
    coname: "",
    conumber: "",
    cuemail: "",
    cuabout: "",
  });

  const handleChange = (e) => {
    setFormData({
      ...formData,
      [e.target.name]: e.target.value,
    });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();

    console.log("Form Data:", formData);

    // Assuming the Express server is running on port 5000
    const serverUrl = "http://localhost:3000/contact";

    try {
      const response = await fetch(serverUrl, {
        method: "POST",
        headers: {
          "Content-Type": "application/json",
        },
        body: JSON.stringify(formData),
      });

      if (response.ok) {
        alert("Form submitted successfully!");
      } else {
        alert("Error submitting form. Please try again later.");
      }
    } catch (error) {
      alert("Network error. Please try again later.");
    }
  };

  return (
    <div>
      <div className="container">
        <h1>INQUIRE</h1>
        <form onSubmit={handleSubmit}>
          <div className="form-group">
            <label htmlFor="cuname">Name: </label>
            <input
              type="text"
              placeholder="Enter your name"
              id="cuname"
              name="cuname"
              value={formData.cuname}
              onChange={handleChange}
            ></input>
          </div>
          <br></br>
          <br></br>
          <br></br>
          <div className="form-group">
            <label htmlFor="coname">Company: </label>
            <input
              type="text"
              placeholder="Company Name"
              id="coname"
              name="coname"
              value={formData.coname}
              onChange={handleChange}
            ></input>
          </div>
          <br></br>
          <br></br>
          <br></br>
          <div className="form-group">
            <label htmlFor="conumber">Mobile No.: </label>
            <input
              type="text"
              placeholder="Enter your contact number"
              id="conumber"
              name="conumber"
              value={formData.conumber}
              onChange={handleChange}
            ></input>
            <br></br>
            <br></br>
            <br></br>
          </div>
          <div className="form-group">
            <label htmlFor="cuemail">Email ID: </label>
            <input
              type="text"
              placeholder="Enter your email address"
              id="cuemail"
              name="cuemail"
              value={formData.cuemail}
              onChange={handleChange}
            ></input>
            <br></br>
            <br></br>
            <br></br>
          </div>
          <div className="form-group">
            <label htmlFor="cuabout">About: </label>
            <input
              type="text"
              placeholder="Enter your query"
              id="cuabout"
              name="cuabout"
              value={formData.cuabout}
              onChange={handleChange}
            ></input>
            <br></br>
            <br></br>
            <br></br>
          </div>
          <div className="form-group"></div>
          <label htmlFor="cusubmit">&nbsp;</label>
          <input
            type="submit"
            id="cusubmit"
            name="cusubmit"
            value="Submit"
          ></input>
        </form>
      </div>
      <div className="address-sec">
        <h2>Located At:</h2>
        <p>
          <strong>Windsor Precision Works</strong>
          <br></br>"6240 Hawthorne Drive"
          <br></br>"Windsor, ON N8T 1J9"
          <br></br>"Canada"
          <br></br>
          <br></br>
          <br></br>"519-721-4143"
          <br></br>"info@precisionworks.ca"
        </p>
      </div>
    </div>
  );
}

export default Contact;
